import Foundation

class Solution {
    func lengthOfLongestSubstring(_ s: String) -> Int {
        let word = Array(s)
        var dict: [Character : Int] = [:]
        
        var lastRepeat = 0
        var nextPoint = 0
        var save = 0
        var i = 0
        
        while i < s.count {
            if let existValue = dict[word[i]], existValue != i, existValue >= nextPoint {
//                print(word[i])
//                print(i)
                if save < (i - nextPoint) {
                    save = i - nextPoint
                }
                lastRepeat = existValue
                nextPoint = lastRepeat + 1
                
                dict[word[i]] = i
                i = nextPoint
//                print(existValue)
//                print(lastRepeat)
//                print(nextPoint)
//                print(save)
//                print()
                continue
            }
            
            dict[word[i]] = i
            i += 1
        }
        
        if save < (i - nextPoint) {
            save = i - nextPoint
        }
        
        return save
    }
}

